Ight, so the other day was my first time ever trying out the "sweaty hunter loadout". (Dust rock, Luna's, wardclif and stompees) and I honestly really don't care that much for dust rock. It feels really inconsistent with it's shots and I feel like you have a better chance at killing someone with chaperone. This was only my opinion. If you like dust rock that's great! Just I personally don't really care for it. That's my Ted talk.

